import logo from './logo.svg';
import './App.css';
import Anywhere from './components/hello';
import {Text, SimpleText} from './components/phrase';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Editar <code>src/App.js</code> e salvar para recarregar.
        </p>
        <Anywhere/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
